import React from 'react';
import BootstrapTable from 'react-bootstrap-table-next';
import 'react-bootstrap-table-next/dist/react-bootstrap-table2.min.css';
import cellEditFactory from 'react-bootstrap-table2-editor';
import './App.css';
import './Input.js';

var products = [ {"productID": 1,"productName": "Pięty Mojżesza", "productPrice": 234 },
 {"productID": 2,"productName": "Mokasyny Zagłady", "productPrice": 63 },
 {"productID": 3,"productName": "Sandały Asteriksa", "productPrice": 512 },
 {"productID": 4,"productName": "Croksy Dudy", "productPrice": 3 },
 {"productID": 5,"productName": "Buty Kota w Butach", "productPrice": 100 },];



const columns = [{
  dataField: 'productID',
  text: 'Product ID'
}, {
  dataField: 'productName',
  text: 'Product Name'
}, {
  dataField: 'productPrice',
  text: 'Product Price'
}];

export default () =><div><BootstrapTable
  keyField="id"
  data={ products }
  columns={ columns }
  cellEdit={ cellEditFactory({ mode: 'click' }) }
/>
<form class="pure-form">
    <fieldset>
        <legend>A compact inline form</legend>
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
        <label for="default-remember">
            <input type="checkbox" id="default-remember" />Remember me</label>
        <button type="submit" class="pure-button pure-button-primary">Sign in</button>
    </fieldset>
</form>

</div>
